import { ElementSchemaRegistry } from '@angular/compiler';
import { Component, OnInit } from '@angular/core';
import { ItemComponent } from '../post/items/item.component';
import { Observable, Subject, Subscription, Observer } from "rxjs"
import { ItemsService } from './items.service';

@Component({
  selector: 'app-project',
  templateUrl: './project.component.html',
  styleUrls: ['./project.component.css']
})
export class ProjectComponent implements OnInit {

  cat:string='Select';

  subscription:Subscription
    
  subject = new Subject<number>()

  totalPrice=0

  ngOnInit(){
    this.iServ.getCart().subscribe((data) => {
      this.cart = data;
      let total = 0;
      this.cart.forEach(i => {
        total += i.value;
      })
      this.totalPrice = total;
    })
  }

  items = [
    {name:'iPad', category: 'Electronic', fav:false, value: 120, img:'https://tinyurl.com/zjjzp62e'},
    {name:'Laptop', category: 'Electronic',fav:false, value: 800, img:'data:image/jpeg;base64,'},
    {name:'Wireless Headphones', category: 'Electronic',fav:false, value: 30, img: 'data:image/jpeg;base64,'},
    {name:'Monitor', category: 'Electronic',fav:false, value: 110, img:'data:image/jpeg;base64,'},
    {name:'Dodge Charger 2018', category:'Vehicle', fav:false, value:72999, img:'data:image/jpeg;base64,'},
    {name:'2020 Chevrolet Tahoe', category:'Vehicle', fav:false, value:61998, img:'data:image/jpeg;base64,'},
    {name:'2004 Toyota Corolla', category:'Vehicle', fav:false, value:4995, img:'data:image/jpeg;base64,'},
    {name:'2020 Jeep Wrangler', category:'Vehicle', fav:false, value: 62887, img:'data:image/jpeg;base64,'}
  ]

  cart= [] as any

  

  constructor(private iServ:ItemsService) { 
    
  }

  changeCat(Category) {
    this.cat=Category.value
  }

  fav(e){
    if(document.getElementById(e.target.id).style.color == "gold"){
      document.getElementById(e.target.id).style.color = "black" 
    }
    else{
    document.getElementById(e.target.id).style.color = "gold" 
  }
  }

  add(cart:any){
    this.iServ.add(cart)
  }

  
  
}
